import React, { useState } from 'react';
import { Form, Input, DatePicker, Button, message, Row, Col } from 'antd';
import axios from 'axios';

const RegistroSiniestroForm = () => {
    const [loading, setLoading] = useState(false);
    const nombres = localStorage.getItem('nombre');
    const token = localStorage.getItem('token');

    const onFinish = async (values) => {
        console.log("token que se tiene: " + token);
        setLoading(true);
        try {
            values.AjustadorQueRegistra = nombres;
            values.Fecha_Ocurrido = values.Fecha_Ocurrido.format('YYYY-MM-DD');
            values.Fecha_Atencion = values.Fecha_Atencion.format('YYYY-MM-DD');

            const jsonData = JSON.stringify(values); // Serializar los datos como JSON
            console.log("Datos a enviar" + jsonData)
            await axios.post('http://localhost:8000/Siniestros/RegistrarSiniestro', jsonData, {
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': token,
                }
            });
            message.success('Siniestro registrado correctamente');
        } catch (error) {
            message.error('Error al registrar el siniestro');
        }
        setLoading(false);
    };

    return (
        <div style={{ backgroundColor: '#21C0DC', padding: '20px', borderRadius: '8px' }}>
            <div style={{ textAlign: 'center', display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%' }}>
                <img src="https://www.bbva.es/content/dam/public-web/global/images/micro-illustrations/plan_estar_seguro_dark.png.img.1176.1712051293742.png" style={{maxHeight: '200px'}} alt="Imagen de registro de siniestro"></img>
            </div>
            <div style={{backgroundColor: 'red', borderRadius: '20px', padding: '1rem'}}>
            <Form
                layout="vertical"
                onFinish={onFinish}
            >
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Numero_Siniestro"
                            label="Número de Siniestro"
                            rules={[{ required: true, message: 'Por favor ingresa el número de siniestro' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Folio_Edua"
                            label="Folio EDUA"
                            rules={[{ required: true, message: 'Por favor ingresa el folio EDUA' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Fecha_Ocurrido"
                            label="Fecha de Ocurrido"
                            rules={[{ required: true, message: 'Por favor selecciona la fecha' }]}
                        >
                            <DatePicker format="YYYY-MM-DD" style={{ width: '100%' }} />
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Fecha_Atencion"
                            label="Fecha de Atención"
                            rules={[{ required: true, message: 'Por favor selecciona la fecha' }]}
                        >
                            <DatePicker format="YYYY-MM-DD" style={{ width: '100%' }} />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Numero_Poliza"
                            label="Número de Póliza"
                            rules={[{ required: true, message: 'Por favor ingresa el número de póliza' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Serie_Vin"
                            label="Serie VIN"
                            rules={[{ required: true, message: 'Por favor ingresa la serie VIN' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Placa_Vehiculo"
                            label="Placa del Vehículo"
